import React from 'react';
import './DrinkBox.css';
import DrinkList from '../DrinkList/DrinkList';

class DrinkBox extends React.Component{
  constructor(props){
    super(props);

  }

  render(){
    return (
      <div className="Playlist">
        <DrinkList drinks  = {this.props.playlistTracks} 
        onRemove = {this.props.onRemove} 
        isRemoval = {true}/>
      </div>
    );
  }
}
export default DrinkBox;
